function mousemove( event ) {

	this.position.x = Math.sin( -event.clientX / 500 ) * 4;
	this.position.z = Math.cos( -event.clientX / 500 ) * 4;
	this.position.y = Math.cos( -event.clientY / 100 ) * 4;
	this.lookAt( scene.position );




}

